description:
Ned Boulting is joined by Gareth Southgate to present action from today's fourth-round fixtures, which were Oldham Athletic v Liverpool at Boundary Park, Brentford v Chelsea at Griffin Park and Leeds United v Tottenham Hotspur at Elland Road. The three Premier League sides were looking to avoid an upset on their travels, with places in the last 16 at stake. With commentary by Clive Tyldesley and Andy Townsend. Plus, reaction to the draw for round five.

 Oldham Athletic v Liverpool
 Brentford v Chelsea
 Leeds v Tottenham

